// src/App.js
import React, { useState, useEffect } from "react";
import { Button } from "@/components/ui/button";
import {
  Select,
  SelectTrigger,
  SelectValue,
  SelectContent,
  SelectItem,
} from "@/components/ui/select";
import { Card, CardContent } from "@/components/ui/card";

function App() {
  const [homeTeam, setHomeTeam] = useState("");
  const [awayTeam, setAwayTeam] = useState("");
  const [teamOptions, setTeamOptions] = useState([]);
  const [result, setResult] = useState(null);
  const [probs, setProbs] = useState(null);
  const [rankings, setRankings] = useState({ home: null, away: null });

  useEffect(() => {
    fetch("http://127.0.0.1:8000/teams")
      .then((res) => res.json())
      .then((data) => {
        setTeamOptions(data.teams);
      });
  }, []);

  const handlePredict = async () => {
    const featureRes = await fetch(
      `http://127.0.0.1:8000/features?home=${homeTeam}&away=${awayTeam}`
    );
    const featureData = await featureRes.json();
    setRankings({ home: featureData.home_rank, away: featureData.away_rank });

    const res = await fetch("http://127.0.0.1:8000/predict", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ features: featureData.features }),
    });

    const data = await res.json();
    setResult(data.result);
    setProbs(data.probabilities);
  };

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center">
      <div className="bg-white p-6 rounded-2xl shadow-xl w-full max-w-md">
        <h1 className="text-2xl font-bold mb-6 text-center text-blue-700">
          プレミアリーグ 勝敗予測アプリ ⚽
        </h1>

        <div className="mb-4">
          <label className="block mb-1 font-medium">ホームチーム：</label>
          <Select value={homeTeam} onValueChange={setHomeTeam}>
            <SelectTrigger className="w-full">
              <SelectValue placeholder="選択してください" />
            </SelectTrigger>
            <SelectContent>
              {teamOptions.map((opt) => (
                <SelectItem key={opt.value} value={opt.label}>
                  {opt.label}
                </SelectItem>
              ))}
            </SelectContent>
          </Select>
        </div>

        <div className="mb-4">
          <label className="block mb-1 font-medium">アウェイチーム：</label>
          <Select value={awayTeam} onValueChange={setAwayTeam}>
            <SelectTrigger className="w-full">
              <SelectValue placeholder="選択してください" />
            </SelectTrigger>
            <SelectContent>
              {teamOptions.map((opt) => (
                <SelectItem key={opt.value} value={opt.label}>
                  {opt.label}
                </SelectItem>
              ))}
            </SelectContent>
          </Select>
        </div>

        <Button
          onClick={handlePredict}
          disabled={!homeTeam || !awayTeam}
          className="w-full mb-4"
        >
          予測する
        </Button>

        {rankings.home && rankings.away && (
          <div className="mb-4 text-sm text-gray-700">
            <p>ホーム順位: {rankings.home}</p>
            <p>アウェイ順位: {rankings.away}</p>
          </div>
        )}

        {result !== null && (
          <Card>
            <CardContent className="pt-4">
              <h2 className="text-lg font-semibold mb-2">予測結果</h2>
              <p>結果: {result === 0 ? "アウェイ勝利" : result === 1 ? "引き分け" : "ホーム勝利"}</p>
              <p>ホーム勝利: {probs.home_win}</p>
              <p>引き分け: {probs.draw}</p>
              <p>アウェイ勝利: {probs.away_win}</p>
            </CardContent>
          </Card>
        )}
      </div>
    </div>
  );
}

export default App;
